UPDATE `parts` SET `id` = 241,`id_category` = 3,`name` = 'BT152-600R',`description` = 'Thyristor BT152 Series 600 V 1 mA , TO-220AB, 3 Pins',`instock` = 10,`mininstock` = 0,`comment` = 'https://nl.wikipedia.org/wiki/Thyristor\r\n\r\nEen thyristor is een halfgeleider, met de werking van een elektronische schakelaar, die geschikt is om grote vermogens bij hoge spanningen met betrekkelijk weinig verlies te schakelen.\r\n\r\nWerking\r\nEen thyristor gedraagt zich als een schakelbare diode, die met een extra stuuraansluiting (de z.g. gate), te bedienen is. De kathode wordt gemeenschappelijk gebruikt voor hoofd- en stuurstroom. Bij het aanleggen van een positieve gelijkspanning op de anode ten opzichte van de kathode, kan de thyristor door een triggerpuls op de gate in geleiding gebracht worden; er loopt dan een stroom door de thyristor en door de belasting. Als er eenmaal stroom loopt blijft deze lopen ongeacht de spanning op de gate. Dit is goed te zien in het vervangingsschema: beide transistoren sturen elkaar open. Wel neemt de dissipatie (warmte-ontwikkeling) in de thyristor toe naarmate er meer stroom door de gate loopt. Daarom wordt in professionele regelingen een reeks korte pulsjes (pulstrein) gebruikt. De thyristor schakelt pas weer uit als de stroom erdoor onder een minimumwaarde daalt. Deze grens wordt de houdstroom (IH) genoemd en verschilt per type thyristor. Een thyristor kan daarom alleen bij gelijkgerichte wisselspanning worden gebruikt, want tijdens de nuldoorgang is de stroom kleiner dan de houdstroom, zie afbeelding. Als de anodespanning negatief wordt gedraagt de thyristor zich als isolator.',`visible` = 0,`id_footprint` = NULL,`id_storelocation` = 20,`order_orderdetails_id` = NULL,`order_quantity` = 1,`manual_order` = 0,`id_manufacturer` = NULL,`id_master_picture_attachement` = 41,`manufacturer_product_url` = '',`datetime_added` = '2019-07-07 16:24:47',`last_modified` = '2020-02-14 17:36:44',`favorite` = 0 WHERE `parts`.`id` = 241;
